import React from "react";
import './Nav.scss';
import logo from '../../assets/images/logo.png'
  


class Nav extends React.Component {
        render() {
            return (
              <>  
                <div className="topnav">
                        <a className="content">AUTUMN SALE: OUR BEST PRICES EVER</a>
                </div>
                <div>
                    <image src={logo}/>
                </div>    
               </>
            )   

        }
}

export default Nav;
